import React from 'react';
import { Provider } from 'react-redux';
import store from './store';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import SymptomList from './components/Symptom/SymptomList';
import SymptomForm from './components/Symptom/SymptomForm';
import Filter from './components/Symptom/Filter';
import Summary from './components/Symptom/Summary';

function App() {
  return (
    <Provider store={store}>
      <div>
        <h1>SymptomSense</h1>
        <Login />
        <Register />
        <SymptomList />
        <SymptomForm />
        <Filter />
        <Summary />
      </div>
    </Provider>
  );
}

export default App;
